import React from 'react';

const Experiences = () => {
    return (
        <div className='experience'>
            <h3>Experiences</h3>
            <div className='exp-1'>
                 <h4>Stage Développement front-end</h4>
                 <h5>Laboratoire Bordelais de Recherche en Informatique | Avril 2022 -Juin 2022</h5>
                 <p>Réalisation d'une interface web pour visualiser les résultats d'une classification
                    d'images biologique par Deep learning.
                 </p>
            </div>
            <div className='exp-2'>
                 <h4>Stage Développement</h4>
                 <div className=''>btn
                </div>
                 <h5>VisionGuinee | Juin 2021 -Juillet 2021</h5>
                 <p> Amélioration et ajustement du code source d'un site web d'informatiques.
                 </p>
            </div>

        </div>
    );
};

export default Experiences;
